        key: i,
        name: `Edward King ${i}`,
        age: 32,
        address1: `London, Park Lane no. ${i}`,
        address2: `London, Park Lane no. ${i}`,
        address3: `London, Park Lane no. ${i}`,
        address4: `London, Park Lane no. ${i}`,
        children: [
          {
            key: i + '-' + 1,
            name: `Edward King ${i}`,
            age: 32,
            address1: `London, Park Lane no. ${i}`,
            address2: `London, Park Lane no. ${i}`,
            address3: `London, Park Lane no. ${i}`,
            address4: `London, Park Lane no. ${i}`,
          },
          {
            key: i + '-' + 2,
            name: `Edward King ${i}`,
            age: 32,
            address1: `London, Park Lane no. ${i}`,
            address2: `London, Park Lane no. ${i}`,
            address3: `London, Park Lane no. ${i}`,
            address4: `London, Park Lane no. ${i}`,
            children: [
              {
                key: i + '-2-' + 1,
                name: `Edward King ${i}`,
                age: 32,
                address1: `London, Park Lane no. ${i}`,
                address2: `London, Park Lane no. ${i}`,
                address3: `London, Park Lane no. ${i}`,
                address4: `London, Park Lane no. ${i}`,
                children: [
                  {
                    key: i + '-2-1-' + 1,
                    name: `Edward King ${i}`,
                    age: 32,
                    address1: `London, Park Lane no. ${i}`,
                    address2: `London, Park Lane no. ${i}`,
                    address3: `London, Park Lane no. ${i}`,
                    address4: `London, Park Lane no. ${i}`,
                  },
                  {
                    key: i + '-2-1-' + 2,
                    name: `Edward King ${i}`,
                    age: 32,
                    address1: `London, Park Lane no. ${i}`,
                    address2: `London, Park Lane no. ${i}`,
                    address3: `London, Park Lane no. ${i}`,
                    address4: `London, Park Lane no. ${i}`,
                  },
                ],
              },
              {
                key: i + '-2-' + 2,
                name: `Edward King ${i}`,
                age: 32,
                address1: `London, Park Lane no. ${i}`,
                address2: `London, Park Lane no. ${i}`,
                address3: `London, Park Lane no. ${i}`,
                address4: `London, Park Lane no. ${i}`,
              },
            ],
          },
          {
            key: i + '-' + 3,
            name: `Edward King ${i}`,
            age: 32,
            address1: `London, Park Lane no. ${i}`,
            address2: `London, Park Lane no. ${i}`,
            address3: `London, Park Lane no. ${i}`,
            address4: `London, Park Lane no. ${i}`,
          },
        ],
      })
    }
    return data
  })()}
